// Navbar.js
import React from 'react';
import './Navbar.css'
import logo from '../../assets/logo.png'
import contactLogo from "../../assets/contactUs.png"
import { Link } from 'react-scroll';
import useScrollIndicator from './useScrollIndicator'; // Update the import path

const Navbar = () => {
  const scrolled = useScrollIndicator();

  return (
    <nav className={`navbar${scrolled > 0 ? ' scrolled' : ''}`}>
      <img className="logo" src={logo} alt="logo" />

      <div className="desktopMenu">
        <Link className="desktopMenuListItems">Home</Link>
        <Link className="desktopMenuListItems">About</Link>
        <Link className="desktopMenuListItems">Portfolio</Link>
        <Link className="desktopMenuListItems">Clients</Link>
      </div>

      <button className="desktopMenuBtn">
        <img className="desktopMenuImg" src={contactLogo} alt="" />Contact Me
      </button>
    </nav>
  );
}

export default Navbar;
